        //     <Link to="/">
        //         <span>Home</span>
        //     </Link>
        //     <Link to={'/anime/action'}>
        //         <span>
        //             Action
        //         </span>
        //     </Link>		
        //     <Link to={'/anime/drama'}>
        //         <span>
        //             Drama
        //         </span>
        //     </Link>	
        //     <Link to={'/anime/comedy'}>
        //         <span>
        //             Comedy
